define('views/homepage', ['l10n', 'storage', 'z'], function(l10n, storage, z) {

    function togglePlay() {
        if (storage.getItem('paid')) {
            $('.play').toggleClass('hidden');
            $('.purchase-form').addClass('hidden');
        } else {
            $('.play').addClass('hidden');
            $('.purchase-form').removeClass('hidden');
        }
    }

    z.body.on('click', '#purchase', function(e) {
        e.preventDefault();
        function token(res) {
            var $input = $('<input type="hidden" name="stripeToken">').val(res.id);
            $('.purchase-form').append($input).trigger('submit');
        }
        StripeCheckout.open({
            key:         'pk_test_hkKdpONxdZQUP1CCexxlJHRn',
            amount:      1995,
            currency:    'usd',
            name:        'HexGL',
            description: 'A futuristic racing game',
            panelLabel:  'Purchase for',
            token:       token,
            image:       'data:image/png;base64,'
        });
    }).on('submit', '.purchase-form', function(e) {
        e.preventDefault();
        e.stopPropagation();
        storage.setItem('paid', '1');
        togglePlay();
    });

    var gettext = l10n.gettext;

    return function(builder) {
        builder.start('homepage.html').done(function() {
        });

        builder.z('type', 'root');
        // builder.z('title', gettext('Home'));
    };
});
